import axios from 'axios';
import React from 'react';

export default function Formulario({ onSubmit }) {
    function data(event) {
        event.preventDefault();
        const formData = new FormData(event.currentTarget);

        const name = formData.get("name");
        const phone = formData.get("phone");

        console.log(`Nombre: ${name}`);
        console.log(`Teléfono: ${phone}`);

        alert(`Nombre: ${name}\nTeléfono: ${phone}`);
    }

    return (
        <div className="container-fluid mt-5">   
            <section>
                <h2>Formulario</h2>
                <form className="card border-primary mb-3" onSubmit={onSubmit}>
                    <div className='p-5 '>
                        <div className='form-group '>
                            <label className="col-sm-2 col-form-label" htmlFor='inpNombre'>Nombre:</label>
                            <input 
                            required
                            id='inpNombre' 
                            name="name" 
                            type='text'
                            className='form-control'
                            placeholder='Ingrese su nombre' />
                        </div>

                        <div className='form-group'>
                            <label className="col-sm-2 col-form-label" htmlFor="inpTel">Numero de telefono:</label>
                            <input 
                            required
                            id="inpTel" 
                            name="phone" 
                            type='number' 
                            className='form-control' 
                            placeholder='Ingrese su numero de telefono' />
                        </div>

                        <div className='form-group'>
                            <button type="submit" className="btn btn-info">Subir</button>
                        </div>
                    </div>
                </form>
            </section>
        </div>
    );
}
